import { Outlet, Link } from "react-router-dom";

const Layout = () => {
  return (
    <>
      <nav style={{ display: "flex", justifyContent: "flex-end" }}>
        <ul style={{ listStyle: "none", display: "flex", alignItems: "center" }}>
          <li style={{ marginRight: "20px" }}>
            <Link to="/">Home</Link>
          </li>
          <li style={{ position: "relative", marginRight: "20px" }}>
            <Link to="/events">Events</Link>
            <ul style={{ position: "absolute", top: "100%", left: 0, listStyle: "none", display: "none" }}>
              <li><Link to="/events/item1">Item1</Link></li>
              <li><Link to="/events/item2">Item2</Link></li>
            </ul>
          </li>
          <li>
            <Link to="/">Our Team</Link>
          </li>
        </ul>
      </nav>

      <Outlet />
    </>
  );
};

export default Layout;
